        __M_writer(u'"/></a>\n    <p><a class="ljicon" href="http://skyrave.livejournal.com/">\u0414\u043c\u0438\u0442\u0440\u0438\u0439_skyrave_\u0412\u043e\u0440\u043e\u043d\u0438\u043d</a> \u0414\u0438\u043c\u0430 \u0412\u043e\u0440\u043e\u043d\u0438\u043d \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u043a\u0443\u0441\u0441\u0438\u0435\u0439 (\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c \u0434\u0436\u0435\u043c\u0431\u0435) \u0432\u0441\u0435\u0433\u043e \u0441 \u0432\u0435\u0441\u043d\u044b 2009 \u0433\u043e\u0434\u0430, \u043d\u043e \u0443\u0436\u0435 \u0443\u0441\u043f\u0435\u043b \u043f\u043e\u043b\u0443\u0447\u0430\u0432\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u043a\u0430\u043a \u043c\u0443\u0437\u044b\u043a\u0430\u043d\u0442 \u043d\u0430 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044f\u0445 \u0432 \u041f\u043e\u043b\u044c\u0448\u0435, \u0420\u0443\u043c\u044b\u043d\u0438\u0438 \u0438 \u0443 \u043d\u0430\u0441 \u0432 \u0423\u043a\u0440\u0430\u0438\u043d\u0435. \u0412\u0441\u0451 \u044d\u0442\u043e \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432\u0430 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u043c\u0443\u0437\u044b\u043a\u0438 \u0438 \u0442\u0430\u043d\u0446\u0430 \xab\u0414\u0430\u043d\u0430 \u0438 \u041a\u0430\u043d\u0430\u0440\u0435\u0439\u043a\u0430\xbb.\n\n    </p><p>\u0422\u0430\u043a\u0436\u0435 \u0441 \u043b\u0435\u0442\u0430 2009 \u0433\u043e\u0434\u0430 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0435 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u0432 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u043f\u0435\u0440\u0432\u043e\u0439 \u0448\u043a\u043e\u043b\u044b \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u044d\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u043e\u0432 \u0432 \u0423\u043a\u0440\u0430\u0438\u043d\u0435 &mdash; \xabGoDoPaTa School\xbb. \u0421 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 2009 \u0433\u043e\u0434\u0430 \u0448\u043a\u043e\u043b\u0430 \u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u0437\u0430\u043d\u044f\u0442\u0438\u044f \u043f\u043e \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c \u0442\u0430\u043d\u0446\u0430\u043c \u043f\u043e\u0434 \u0436\u0438\u0432\u044b\u0435 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u044b.</p>\n\n    <p>\u041d\u0430 \u0432\u0435\u0447\u0435\u0440\u0435 \u0431\u044b\u043b\u0438 \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0435 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \xabGoDoPaTa\xbb \u0441\u043e \u0441\u0432\u043e\u0438\u043c \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u043c \u041c\u0430\u0442\u0432\u0435\u0435\u043c. \u0417\u0430 \u0431\u043e\u043b\u044c\u0448\u0438\u043c\u0438 \u0431\u0430\u0441\u043e\u0432\u044b\u043c\u0438 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u0430\u043c\u0438 \u0434\u0443\u043d\u0443\u043d\u0430\u043c\u0438 \u0438\u0433\u0440\u0430\u043b\u0438 \u0434\u0435\u0432\u0443\u0448\u043a\u0438 \u042e\u043b\u044f, \u0421\u0430\u0448\u0430 \u0438 \u0412\u0438\u043a\u0442\u043e\u0440\u0438\u044f. \u041d\u0430 \u0434\u0436\u0435\u043c\u0431\u0435 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u043b\u0438 \u0414\u0438\u043c\u0430 \u0412\u043e\u0440\u043e\u043d\u0438\u043d \u0438 \u0412\u0435\u0434\u043e\u043c\u0438\u0440. \u0421\u043e\u043b\u0438\u0440\u043e\u0432\u0430\u043b \u041c\u0430\u0442\u0432\u0435\u0439.</p>\n\n    <p>\u0411\u044b\u043b\u0430 \u0441\u044b\u0433\u0440\u0430\u043d\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u043c\u0435\u043b\u043e\u0434\u0438\u044f \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0441\u0442\u0438 \u0411\u0430\u0433\u0430 \u0438\u0437 \u0413\u0432\u0438\u043d\u0435\u0438 (\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430) \xabMakru\xbb, \u043e\u0431\u044b\u0447\u043d\u043e \u043f\u043e\u0434 \u044d\u0442\u043e\u0442 \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e \u0431\u044b\u0441\u0442\u0440\u044b\u0439 \u0440\u0438\u0442\u043c \u0442\u0430\u043d\u0446\u0435\u0432\u0430\u043b\u0438 \u0436\u0435\u043d\u0449\u0438\u043d\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043d\u0435 \u043c\u043e\u0433\u043b\u0438 \u0432\u043e\u0437\u0434\u0435\u0440\u0436\u0430\u0442\u044c\u0441\u044f \u043e\u0442 \u0442\u0430\u043d\u0446\u0430, \u0443\u0441\u043b\u044b\u0448\u0430\u0432 \xab\u041c\u0430\u043a\u0440\u0443\xbb, \u0447\u0435\u043c \u0432\u044b\u0437\u044b\u0432\u0430\u043b\u0438 \u0441\u043c\u0435\u0445 \u0443 \u043e\u043a\u0440\u0443\u0436\u0430\u044e\u0449\u0438\u0445 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 \u0434\u0435\u0440\u0435\u0432\u043d\u0438</p>\n    <p><a href="http://ru.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D0%BC%D0%B1%D0%B5">\u041f\u043e\u0434\u0440\u043e\u0431\u043d\u0435\u0435 \u043e\u0431 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0435 \u0434\u0436\u0435\u043c\u0431\u0435</a></p>\n    <p>\u0411\u043e\u043b\u044c\u0448\u0435 \u043e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0435: <a class="vicon green_a" href="http://vkontakte.ru/club13472008">\u0413\u043e\u0414\u043e\u041f\u0430\u0422\u0430</a></p>\n</div>\n\n<div class="info_block">\n    <h3>\u0414\u0443\u044d\u0442 \u0438\u0437 \u041c\u0438\u043d\u0441\u043a\u0430</h3>\n    <a name="st" class="gall" href="')
