        __M_writer(u'"/></a>\n    <p><a class="ljicon" href="http://mehas.livejournal.com">\u041c\u0438\u0448\u0430 \u041e\u043a\u0443\u043d\u0435\u0432</a> \u0424\u043e\u0440\u0442\u0435\u043f\u0438\u0430\u043d\u043e - \u043c\u043e\u0435 \u0445\u043e\u0431\u0431\u0438. \u041a\u043e\u0433\u0434\u0430-\u0442\u043e \u044f \u0443\u0447\u0438\u043b\u0441\u044f \u0432 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0439 \u0448\u043a\u043e\u043b\u0435, \u0438 \u0434\u0430\u0436\u0435 \u0434\u0443\u043c\u0430\u043b \u043d\u0430\u0434 \u043f\u043e\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435\u043c \u0432 \u043c\u0443\u0437\u0443\u0447\u0438\u043b\u0438\u0449\u0435, \u043d\u043e \u043b\u044e\u0431\u043e\u0432\u044c \u043a \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044e \u043e\u043a\u0430\u0437\u0430\u043b\u0430\u0441\u044c \u0441\u0438\u043b\u044c\u043d\u0435\u0435. \u0421\u043a\u0430\u0436\u0443 \u0447\u0435\u0441\u0442\u043d\u043e, \u0447\u0442\u043e \u043f\u043e\u043b\u044e\u0431\u0438\u0442\u044c \u043c\u0443\u0437\u044b\u043a\u0443 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u043e\u0441\u044c \u043d\u0435 \u0441\u0440\u0430\u0437\u0443, \u043f\u043e\u0442\u043e\u043c\u0443 \u0447\u0442\u043e \u0432 \u043c\u043b\u0430\u0434\u0448\u0438\u0445 \u043a\u043b\u0430\u0441\u0441\u0430\u0445 \u044f \u0445\u043e\u0442\u0435\u043b \u0441\u0436\u0435\u0447\u044c \u0438\u043b\u0438 \u0441\u043b\u043e\u043c\u0430\u0442\u044c \u0444\u043e\u0440\u0442\u0435\u043f\u0438\u0430\u043d\u043e \u0438 \u0432\u043e\u043e\u0431\u0449\u0435 \u043f\u0440\u043e\u0441\u0438\u043b, \u0447\u0442\u043e\u0431\u044b \u043c\u0435\u043d\u044f \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u0438\u0437 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0439 \u0448\u043a\u043e\u043b\u044b, \u043d\u043e \u043c\u043d\u0435 \u043f\u043e\u0432\u0435\u0437\u043b\u043e \u0441 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u043e\u043c. \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u044f\u043c\u0438. \u0438 \u044d\u0442\u043e\u0433\u043e \u043d\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e. \u041c\u043e\u0438 \u043b\u044e\u0431\u0438\u043c\u044b\u0435 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u044b - \u0420\u0430\u0445\u043c\u0430\u043d\u0438\u043d\u043e\u0432 \u0438 \u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d. \u0413\u043e\u0434 \u043d\u0430\u0437\u0430\u0434 \u044f \u043d\u0430\u0447\u0430\u043b \u0430\u043a\u0442\u0438\u0432\u043d\u043e \u0437\u0430\u043d\u0438\u043c\u0430\u0442\u044c\u0441\u044f \u0441\u043d\u043e\u0432\u0430 \u0438 \u0431\u044b\u043b \u043e\u0447\u0435\u043d\u044c \u0440\u0430\u0434, \u043a\u043e\u0433\u0434\u0430 \u041c\u0438\u0448\u0430 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u043f\u043e\u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0432 \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u0435, \u043d\u0430\u0434\u0435\u044e\u0441\u044c, \u0447\u0442\u043e \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u043e\u0441\u044c \u043d\u0435\u043f\u043b\u043e\u0445\u043e.</p>\n</div>\n\n<div class="info_block">\n    <h3>\u0413\u0430\u043b\u0438\u043d\u0430 \u0414\u0438\u0432\u0430\u043a\u043e\u0432\u0430</h3>\n    <a name="gd" class="gall" href="')
