        __M_writer(u'"/></a>\n    <p><a class="ljicon" href="http://chichiruchan.livejournal.com">\u0413\u0430\u043b\u0438\u043d\u0430 \u0414\u0438\u0432\u0430\u043a\u043e\u0432\u0430</a> </p>\n    <p>\u0414\u0430\u0432\u043d\u0435\u043d\u044c\u043a\u043e \u0443\u0432\u043b\u0435\u043a\u0430\u044e\u0441\u044c \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u0441\u0435\u0440\u0438\u0430\u043b\u0430\u043c\u0438 (\u043d\u043e \u043d\u0435 \u0441\u0442\u0440\u0430\u043d\u043e\u0439), \u0432\u043e\u0442 \u0443\u0436 \u0447\u0442\u043e, \u0430 \u0438\u0445 \u0431\u043e\u043b\u044c\u0448\u0443\u044e \u0447\u0430\u0441\u0442\u044c \u0442\u0430\u043c \u0434\u0435\u043b\u0430\u044e\u0442 \u043f\u0440\u043e\u0441\u0442\u043e \u0432\u0435\u043b\u0438\u043a\u043e\u043b\u0435\u043f\u043d\u043e. \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e, \u0432\u0441\u0435 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441 "\u0411\u0430\u0444\u0444\u0438". \u0414\u0430\u043b\u044c\u0448\u0435 \u0441\u043f\u0438\u0441\u043e\u043a \u043f\u0435\u0440\u0435\u0447\u0438\u0441\u043b\u044f\u0442\u044c \u043a\u0430\u043a-\u0442\u043e \u0441\u0442\u044b\u0434\u043d\u043e ^^" \u0423\u0436 \u043e\u0447\u0435\u043d\u044c \u043e\u043d \u0431\u043e\u043b\u044c\u0448\u043e\u0439. \u0412\u043e\u043e\u0431\u0449\u0435-\u0442\u043e, \u043d\u0430 \u0432\u0435\u0447\u0435\u0440 \u044f \u0441\u043e\u0431\u0438\u0440\u0430\u043b\u0430\u0441\u044c \u0434\u0435\u043b\u0430\u0442\u044c \u0434\u0440\u0443\u0433\u043e\u0435 \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435, \u0430 \u0432\u044b\u043b\u0438\u043b\u043e\u0441\u044c \u0432\u0441\u0451 \u0432 \u0432\u0438\u0434\u0435\u043e\u0440\u044f\u0434 \u043f\u043e \u0440\u0430\u0431\u043e\u0442\u0430\u043c \u0414\u0436\u043e\u0441\u0441\u0430 \u0412\u0435\u0434\u043e\u043d\u0430 - \u0441\u043e\u0437\u0434\u0430\u0442\u0435\u043b\u044f \u0442\u043e\u0439 \u0436\u0435 "\u0411\u0430\u0444\u0444\u0438" \u0438 \u0442\u0430\u043a \u0434\u0430\u043b\u0435\u0435. \u041d\u0443 \u0430 \u0435\u0441\u043b\u0438 \u0432\u044b \u043d\u0435 \u0441\u043c\u043e\u0442\u0440\u0435\u043b\u0438 \u0414\u043e\u043a\u0442\u043e\u0440\u0430 \u0425\u043e\u0440\u0440\u0438\u0431\u043b\u0430 \u0438 \u0421\u0432\u0435\u0442\u043b\u044f\u0447\u043a\u0430, \u0442\u043e \u044d\u0442\u043e \u0432 \u043f\u0435\u0440\u0432\u0443\u044e \u043e\u0447\u0435\u0440\u0435\u0434\u044c must see. \u0414\u0436\u043e\u0441\u0441 - \u043e\u043d \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0442\u043e \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u043e\u043c, \u0442\u043e \u0441\u0446\u0435\u043d\u0430\u0440\u0438\u0441\u0442\u043e\u043c, \u0442\u043e \u0435\u0449\u0435 \u043a\u0435\u043c-\u0442\u043e \u0432\u043e \u0432\u0441\u0435\u0445 \u0441\u0432\u043e\u0438\u0445 \u043f\u0440\u043e\u0435\u043a\u0442\u0430\u0445 \u0438 \u0434\u0435\u043b\u0430\u0435\u0442 \u0432\u0441\u0435 \u0443\u0436 \u043e\u0447\u0435\u043d\u044c \u0442\u0430\u043b\u0430\u043d\u0442\u043b\u0438\u0432\u043e \u0438 \u0441 \u043b\u044e\u0431\u043e\u0432\u044c\u044e. \u041f\u0440\u0430\u0432\u0434\u0430, \u043d\u0438\u043a\u0430\u043a\u0438\u0445 \u0445\u044d\u043f\u043f\u0438-\u044d\u043d\u0434\u043e\u0432, \u043b\u0438\u0448\u044c \u0441\u0443\u0440\u043e\u0432\u0430\u044f \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c (\u043d\u0430 \u0444\u043e\u043d\u0435 \u043c\u0435\u0442\u0430\u0444\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0432\u0430\u043c\u043f\u0438\u0440\u043e\u0432/\u0434\u0435\u043c\u043e\u043d\u043e\u0432/etc) - "Killing people is my job", \u043a\u0430\u043a \u043e\u043d \u0433\u043e\u0432\u043e\u0440\u0438\u0442 :) </p>\n</div>\n\n<div class="info_block">\n    <h3>\u0412\u0438\u0442\u0430\u043b\u0438\u0439 \u0411\u043e\u0433\u0434\u0430\u043d\u043e\u0432</h3>\n    <a name="vb" class="gall" href="')
