        __M_writer(u'"/></a>\n    <p><a class="ljicon" href="http://arrai.livejournal.com">\u0412\u0438\u0442\u0430\u043b\u0438\u0439 \u0411\u043e\u0433\u0434\u0430\u043d\u043e\u0432</a> </p>\n    <p>\u0420\u043e\u0434\u0438\u043b\u0441\u044f \u0438 \u0436\u0438\u0432\u0443 \u0432 \u041a\u0438\u0435\u0432\u0435. \u0423\u0432\u043b\u0435\u043a\u0430\u044e\u0441\u044c \u0440\u0438\u0442\u043c-\u0438\u0433\u0440\u0430\u043c\u0438, \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u0438\u043a\u043e\u0439, \u043d\u0430\u0441\u0442\u043e\u043b\u044c\u043d\u044b\u043c\u0438 \u0438\u0433\u0440\u0430\u043c\u0438, \u043c\u0443\u0437\u044b\u043a\u043e\u0439, MtG. \u0412 \u0434\u0430\u043b\u0451\u043a\u043e\u043c \u0434\u0435\u0442\u0441\u0442\u0432\u0435 \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u0443\u044e \u0448\u043a\u043e\u043b\u0443 \u043f\u043e \u043a\u043b\u0430\u0441\u0441\u0443 \u0444\u043e\u0440\u0442\u0435\u043f\u0438\u0430\u043d\u043e. \u0418\u0433\u0440\u0430\u044e \u043d\u0430 \u043a\u043b\u0430\u0432\u0438\u0448\u0430\u0445 \u0432 \u0433\u0440\u0443\u043f\u043f\u0435 "\u041e\u043a\u043e\u0446\u0432\u0456\u0442". \u0412\u044b\u043f\u0443\u0441\u043a\u043d\u0438\u043a \u043a\u0438\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u0430, \u0440\u0430\u0431\u043e\u0442\u0430\u044e \u0432 \u0441\u0444\u0435\u0440\u0435 IT. \u041b\u044e\u0431\u043b\u044e \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c. \u0427\u0430\u0449\u0435 \u0432\u0441\u0435\u0433\u043e \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u0438\u0440\u043e\u0432\u043a\u0438 \u0438 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u044b \u043f\u043e pump it up. \u041d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043b\u0435\u0442 \u043d\u0430\u0437\u0430\u0434 \u0443\u0447\u0438\u043b \u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0439. \u041f\u0440\u0430\u0432\u0434\u0430, \u043f\u043e\u043b\u0442\u043e\u0440\u0430 \u0433\u043e\u0434\u0430 \u0441\u043f\u0443\u0441\u0442\u044f \u043d\u0430\u0448\u0430 \u0441\u044d\u043d\u0441\u044d\u0439 \u0443\u0435\u0445\u0430\u043b\u0430 \u043d\u0430 \u0441\u0442\u0430\u0436\u0438\u0440\u043e\u0432\u043a\u0443 \u0432 \u0441\u0442\u0440\u0430\u043d\u0443 \u0432\u043e\u0441\u0445\u043e\u0434\u044f\u0449\u0435\u0433\u043e \u0441\u043e\u043b\u043d\u0446\u0430, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u0435 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435 \u0431\u044b\u043b\u043e \u0437\u0430\u0431\u0440\u043e\u0448\u0435\u043d\u043e \u043d\u0430 \u0443\u0440\u043e\u0432\u043d\u0435 \u0441\u0434\u0430\u043d\u043d\u043e\u0433\u043e 3 \u043a\u044e. \u041a\u0430\u043a \u043d\u0438 \u0441\u0442\u0440\u0430\u043d\u043d\u043e, \u043f\u043e\u0447\u0442\u0438 \u043d\u0435 \u0441\u043c\u043e\u0442\u0440\u0435\u043b \u0430\u043d\u0438\u043c\u0435, \u043d\u0443 \u043d\u0435 \u0441\u0447\u0438\u0442\u0430\u044f \u043f\u0430\u0440\u044b \u0434\u0435\u0441\u044f\u0442\u043a\u043e\u0432 \u0441\u0435\u0440\u0438\u0430\u043b\u043e\u0432. \u0425\u043e\u0447\u0443 \u043d\u0430\u0443\u0447\u0438\u0442\u044c\u0441\u044f \u0445\u043e\u0440\u043e\u0448\u043e \u0438\u0433\u0440\u0430\u0442\u044c \u043d\u0430 \u0441\u0438\u043d\u0442\u0435\u0437\u0430\u0442\u043e\u0440\u0435 \u0438 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u0430\u0445, \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0432\u043e\u043a\u0430\u043b, \u0441\u044a\u0435\u0437\u0434\u0438\u0442\u044c \u0432 \u042f\u043f\u043e\u043d\u0438\u044e, \u0437\u0430\u0441\u0442\u0430\u0442\u044c \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044e \u043d\u0430 \u041c\u0430\u0440\u0441.</p>\n</div>\n\n<div class="info_block">\n    <h3>\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041c\u0430\u0440\u0438\u043d\u0438\u0447</h3>\n    <a name="am" class="gall" href="')
