        __M_writer(u'"/></a>\n    <p><a class="vicon" href="http://vkontakte.ru/id45499673">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u041f\u0438\u0440\u043e\u0436\u0435\u043d\u043a\u043e</a> - \u0432\u0456\u0440\u0442\u0443\u043e\u0437\u043d\u0438\u0439 \u0433\u0456\u0442\u0430\u0440\u0438\u0441\u0442, \u0441\u043f\u0456\u0432\u0430\u043a, \u043f\u043e\u0435\u0442, \u0444\u0456\u043b\u043e\u0441\u043e\u0444. \u0412\u0438\u043a\u043e\u043d\u0430\u0432\u0435\u0446\u044c \u0432\u043b\u0430\u0441\u043d\u0438\u0445 \u0442\u0432\u043e\u0440\u0456\u0432, \u044f\u043a\u0438\u0445 \u043c\u0430\u0454 \u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e, \u0430\u043b\u0435 \u0446\u0435 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u043e \u043d\u0435 \u043c\u0435\u0436\u0430, \u0431\u043e \u2014 \u0436\u0438\u0442\u0442\u044f \u0442\u0440\u0438\u0432\u0430\u0454! \u0423\u0447\u0430\u0441\u043d\u0438\u043a \u0456 \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u043d\u0442 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0456\u0432 \u0442\u0430 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u0456\u0432. \u041c\u0430\u0454 \u0434\u0432\u0456 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0438 \u0430\u043a\u0443\u0441\u0442\u0438\u0447\u043d\u043e\u0433\u043e \u0437\u0432\u0443\u0447\u0430\u043d\u043d\u044f, \u043a\u043e\u0436\u043d\u0430 \u0437 \u044f\u043a\u0438\u0445 \u043b\u0435\u0433\u043a\u043e \u0442\u0440\u0430\u043d\u0441\u0444\u043e\u0440\u043c\u0443\u0454\u0442\u044c\u0441\u044f \u0443 \u043f\u043e\u0442\u0443\u0436\u043d\u0435 \u0435\u043b\u0435\u043a\u0442\u0440\u043e- \u0437\u0432\u0443\u0447\u0430\u043d\u043d\u044f, \u0434\u043b\u044f \u0431\u043b\u044c\u0448 \u0442\u043e\u0447\u043d\u043e\u0433\u043e, \u0440\u043e\u0437\u043b\u043e\u0433\u0456\u0448\u043e\u0433\u043e \u043f\u043e\u0434\u0430\u043d\u043d\u044f \u043c\u0430\u0442\u0435\u0440\u0456\u044f\u043b\u0443. \u041f\u0440\u043e\u0433\u0440\u0430\u043c\u0438 \u0433\u043e\u0434\u0438\u043d\u043d\u043e\u0433\u043e \u0437\u0432\u0443\u0447\u0430\u043d\u043d\u044f: \xab \u041d\u0456\u0447-\u0414\u0435\u043d\u044c\xbb, \xab\u0423 \u0441\u0442\u0438\u043b\u0456 Rock\xbb, \u043a\u043e\u0436\u043d\u0430 \u0433\u043e\u0434\u0438\u043d\u043d\u043e\u0457 \u0442\u0440\u0438\u0432\u0430\u043b\u043e\u0441\u0442\u0438. \u0422\u0430\u043a\u043e\u0436 \u043c\u0430\u0454 \u0431\u0430\u0433\u0430\u0442\u043e \u043f\u0456\u0441\u0435\u043d\u044c \u044f\u043a\u0456 \u043d\u0435 \u0432\u0445\u043e\u0434\u044f\u0442\u044c \u0434\u043e \u0437\u0433\u0430\u0434\u0430\u043d\u0438\u0445 \u0432\u0438\u0449\u0435 \u043f\u0440\u043e\u0433\u0440\u0430\u043c. \u0412\u0438\u0441\u043e\u043a\u0438\u0439 \u0440\u0456\u0432\u0435\u043d\u044c \u0432\u043e\u043b\u043e\u0434\u0456\u043d\u043d\u044f \u0433\u0456\u0442\u0430\u0440\u043e\u044e \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043c\u0430\u0442\u0438 \u0456 \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u0442\u0438 \u0456\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0456 \u0434\u043e\u0440\u043e\u0431\u043a\u0438.</p>\n</div>\n\n<div class="info_block">\n    <h3>\u041c\u0430\u0440\u0438\u044f \u041a\u043e\u0442\u043e\u0432\u0430</h3>\n    <a name="skoshka" class="gall" href="')
