        __M_writer(u'"/></a>\n    <p><a class="ljicon" href="http://strange-cat.livejournal.com">\u041c\u0430\u0440\u0438\u044f \u041a\u043e\u0442\u043e\u0432\u0430</a> (StrangeCat) - \u0432 \u0441\u0435\u043c\u044c \u043b\u0435\u0442 \u043e\u0434\u0438\u043d \u0433\u043e\u0434 \u0437\u0430\u043d\u0438\u043c\u0430\u043b\u0430\u0441\u044c \u0445\u043e\u0440\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0435\u0439. \u041f\u043e\u0442\u043e\u043c \u043c\u044b \u043f\u0435\u0440\u0435\u0435\u0445\u0430\u043b\u0438, \u0438 \u0438\u0434\u0442\u0438 \u0432 \u0434\u0440\u0443\u0433\u0443\u044e \u0441\u0442\u0443\u0434\u0438\u044e \u044f \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0430\u0441\u044c \u043d\u0430\u043e\u0442\u0440\u0435\u0437. </p>\n    <p class="par">\n    \u0412 11 \u043b\u0435\u0442 \u0437\u0430\u043d\u0438\u043c\u0430\u043b\u0430\u0441\u044c \u043e\u0434\u0438\u043d \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e-\u0442\u0435\u0430\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0441\u0442\u0443\u0434\u0438\u0438. \u041d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0433\u043e\u0434 \u0432\u0440\u0435\u043c\u044f \u0437\u0430\u043d\u044f\u0442\u0438\u0439 \u0441\u0442\u0430\u043b\u043e \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0442\u044c \u0441 \u0441\u0435\u043a\u0446\u0438\u0435\u0439 \u0443-\u0448\u0443, \u0438 \u0442\u0435\u0430\u0442\u0440 \u043f\u0440\u0438\u0448\u043b\u043e\u0441\u044c \u0431\u0440\u043e\u0441\u0438\u0442\u044c. \u0410 \u0435\u0449\u0451 \u0447\u0435\u0440\u0435\u0437 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043c\u0435\u0441\u044f\u0446\u0435\u0432 \u043d\u0430 \u0443-\u0448\u0443 \u043c\u0435\u043d\u044f \u043d\u0435\u0443\u0434\u0430\u0447\u043d\u043e \u043f\u0435\u0440\u0435\u043a\u0438\u043d\u0443\u043b\u0430 \u0447\u0435\u0440\u0435\u0437 \u0441\u0435\u0431\u044f \u043d\u043e\u0432\u0435\u043d\u044c\u043a\u0430\u044f \u0434\u0435\u0432\u043e\u0447\u043a\u0430, \u043f\u0440\u0438\u0448\u0435\u0434\u0448\u0430\u044f \u0438\u0437 \u0434\u0437\u044e-\u0434\u043e \u0438 \u0440\u0435\u0448\u0438\u0432\u0448\u0430\u044f \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u044c \u043d\u0430 \u043c\u043d\u0435 \u043f\u0440\u0438\u0451\u043c\u0447\u0438\u043a. \u0412\u0441\u0451 \u043f\u0440\u0430\u0432\u043e\u0435 \u043f\u043b\u0435\u0447\u043e \u0431\u044b\u043b\u043e \u0441\u043d\u0438\u0437\u0443 \u0441\u0438\u043d\u0435\u0435 \u043e\u0442 \u0440\u0430\u0441\u0442\u044f\u0436\u0435\u043d\u0438\u044f, \u0440\u0443\u043a\u043e\u0439 \u044f \u0448\u0435\u0432\u0435\u043b\u0438\u0442\u044c \u043d\u0435 \u043c\u043e\u0433\u043b\u0430 \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u043b\u0430 \u0445\u043e\u0434\u0438\u0442\u044c \u043d\u0430 \u0443-\u0448\u0443. \u0410 \u043f\u043e\u0441\u043b\u0435 \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0440\u044b\u0432\u0430 \u043f\u043e\u0431\u043e\u044f\u043b\u0430\u0441\u044c \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u0442\u044c\u0441\u044f, \u043f\u043e\u0442\u043e\u043c\u0443 \u0447\u0442\u043e \u043e\u0442\u0441\u0442\u0430\u043b\u0430 \u043e\u0442 \u0441\u0432\u043e\u0438\u0445...</p>\n    <p class="par">\u0412 2007 \u0433\u043e\u0434\u0443 \u043f\u043e\u0434 \u043e\u043a\u043d\u0430\u043c\u0438 \u043c\u043e\u0435\u0433\u043e \u0442\u043e\u0433\u0434\u0430\u0448\u043d\u0435\u0433\u043e \u0434\u043e\u043c\u0430 \u043f\u043e\u0441\u0442\u0440\u043e\u0438\u043b\u0438 \u043d\u0430 \u043c\u043e\u0438\u0445 \u0433\u043b\u0430\u0437\u0430\u0445 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0439 3-\u044d\u0442\u0430\u0436\u043d\u044b\u0439 \u0434\u043e\u043c\u0438\u043a, \u0438 \u043e\u0442\u043a\u0440\u044b\u043b\u0438 \u0432 \u043d\u0451\u043c \u043c\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u043d\u044b\u0445 \u0444\u0438\u0440\u043c \u0438... \u0441\u0442\u0443\u0434\u0438\u044e \u0442\u0430\u043d\u0446\u0435\u0432. \u042f \u0431\u043e\u043b\u044c\u0448\u0435 \u0445\u043e\u0442\u0435\u043b\u0430 \u0431\u044b \u0430\u0439\u043a\u0438\u0434\u043e, \u043d\u043e \u0443\u0432\u044b. \u041d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0434\u0435\u043d\u044c \u043f\u043e\u0441\u043b\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u0441\u0442\u0443\u0434\u0438\u0438 \u044f \u0443\u0436\u0435 \u0431\u044b\u043b\u0430 \u043d\u0430 \u0437\u0430\u043d\u044f\u0442\u0438\u044f\u0445. \u0412\u044b\u0431\u0440\u0430\u043b\u0430 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0435 \u0442\u0430\u043d\u0446\u044b, \u043a\u0430\u043a \u0431\u043e\u043b\u044c\u0448\u0435 \u043f\u043e\u0434\u0445\u043e\u0434\u044f\u0449\u0438\u0435 \u043f\u043e \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u043c\u0435\u043d\u0442\u0443 \u0438 \u043f\u043b\u0430\u0432\u043d\u043e-\u043d\u0435\u0441\u043f\u0435\u0448\u043d\u044b\u0435 (\u043f\u043e \u0441\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u044e \u0441 \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u044b\u043c \u0445\u0430\u0443\u0441\u043e\u043c, \u0441\u0442\u0440\u0438\u0442-\u0434\u044d\u043d\u0441\u043e\u043c \u0438 \u0442. \u043f.). \u0418 \u0432\u043e\u0442, \u0441 \u043f\u0435\u0440\u0435\u0440\u044b\u0432\u0430\u043c\u0438, \u0443\u0436\u0435 2 \u0433\u043e\u0434\u0430 \u043a\u0430\u043a \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0441\u044c \u0441 \u043d\u0430\u0448\u0435\u0439 \u043b\u044e\u0431\u0438\u043c\u043e\u0439 \u0431\u0435\u0441\u0441\u043c\u0435\u043d\u043d\u043e\u0439 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0435\u0439 \u0410\u043d\u0436\u0435\u043b\u0438\u043a\u043e\u0439. \u041e\u043d\u0430 \u043d\u0435 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0438\u0432\u0430\u0435\u0442 \u0432\u044b\u0431\u043e\u0440 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u0439 \u0434\u043b\u044f \u043d\u0430\u0441 \u0441\u0442\u0440\u043e\u0433\u043e \u0431\u0435\u043b\u043b\u0438\u0434\u0430\u043d\u0441\u043e\u043c, \u0438 \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043c\u044b \u0442\u0430\u043d\u0446\u0443\u0435\u043c \u0438 \u0442\u0440\u0430\u0439\u0431\u043b, \u0438 \u0430\u043d\u0434\u0430\u043b\u0443\u0437\u0438\u044e (\u0438\u0441\u043f\u0430\u043d\u043e-\u0430\u0440\u0430\u0431\u0441\u043a\u0438\u0439 \u0442\u0430\u043d\u0435\u0446), \u0438 \u0446\u044b\u0433\u0430\u043d\u0441\u043a\u0438\u0435 \u0442\u0430\u043d\u0446\u044b \u0438... \u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0435\u0449\u0451 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e\u0433\u043e \u043d\u0430\u0441 \u0436\u0434\u0451\u0442 \u0432\u043f\u0435\u0440\u0435\u0434\u0438!</p>\n</div>\n\n<script>\n    $(\'#orgs a.gall\').lightBox();\n</script>\n</div>')
